<template>
    <div class="coor-plan-submit">
		<modal @before-close="setDefaultPaysystem" width=380 height="auto" name="select_paysystem">
		  <div class="appmodal">
			<div class="modal-container">
			  <div class="modal-header modal-header-notify">
				<img v-on:click="hideModal('select_paysystem')" src="/img/delete.svg" alt="icon" class="handleimg" />
				<h3>Elegir sistema de pago</h3>
			  </div>
			</div>
			<div class="faux-borders" style="width: 70%;"></div>
			<div class="modal-container">
			  <div class="modal-body">
				<div class="notify-area">
					<form method="post" action="/tariff/pay/coor-card">
						<input type="hidden" name="_token" :value="csrf" />
						<input type="hidden" :value="postsForForm" name="posts">
						<div class="paysystems-list">
							<div class="item-paysystem" v-on:click="selectPaysystem('paypal')">
								<input type="radio" v-model="paysystem" value="paypal" /> <img src="data:image/svg+xml;base64," />
							</div>
							<div class="item-paysystem" v-on:click="selectPaysystem('card')">
								<input type="radio" v-model="paysystem" value="card" /> <img src="data:image/png;base64," />
							</div>
						</div>
						<div class="item text-center">
							<button type="submit" >
								comprar
							</button>
						</div>
					</form>
				</div>
			  </div>
			</div>
		  </div>
		</modal>
		<modal @before-close="setDefaultPaysystem" draggable=".appmodal" :adaptive="true" :minWidth="320" :maxWidth="580" height="auto" :scrollable="true" name="card_windows">
		  <div class="appmodal">	
			<div class="modal-container">
			  <div class="modal-body">
				<div class="notify-area">
				  <CardForm
					  :form-data="formData"
					  @input-card-number="updateCardNumber"
					  @input-card-name="updateCardName"
					  @input-card-month="updateCardMonth"
					  @input-card-year="updateCardYear"
					  @input-card-cvv="updateCardCvv"
					  @input-card-save="cardSave"
					/>
					<span class="request-error" v-if="requestError.length">{{requestError}}</span>
				</div>
			  </div>
			</div>
		  </div>
		</modal>
		<modal @before-close="setDefaultPaysystem" width=580 height="auto" name="success_windows">
		  <div class="appmodal">
			  <div class="modal-container">
				<div class="modal-header modal-header-notify">
					<h3>
						¡ENHORABUENA!
					</h3>
					<img src="/img/closemodal.svg" alt="modal"  v-on:click="hideModal('success_windows')" />
				</div>
			</div>
			<div class="faux-borders" style="width: 70%;"></div>
			<div class="modal-container">
			  <div class="modal-body">
				<div class="notify-area text-center">
					<img src="/img/check.svg" />
					<span class="request-success">¡PAGO REALIZADO CON ÉXITO!</span>
				</div>
			  </div>
			</div>
		  </div>
		</modal>
		<button class="" v-if="showPagar" v-on:click="showPaysystemModal">pagar</button>
	</div>
</template>

<script>
	import Notify from "./Notify";
	import CardForm from './CardForm'
    export default {
		props: {
			postsForForm: String,
			showPagar: Boolean
		},
		components: {
			CardForm
		},
		data () {
			return {
			  formData: {
				cardName: '',
				cardNumber: '',
				cardMonth: '',
				cardYear: '',
				cardCvv: ''
			  },
			  paysystem: 'paypal',
			  csrf: $('meta[name="csrf-token"]').attr('content'),
			  requestError: ''
			}
		},
		methods: {
			cardSave()
			{
				let object = this.formData;
				// object._token = $('meta[name="csrf-token"]').attr('content');
				object.posts = this.postsForForm;
				
				let formData = new FormData();

				for ( let key in object ) 
				{
					formData.append(key, object[key]);
				}
				
				fetch("/tariff/pay/coor-card",
				{
					headers: {
					  'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
					},
					method: "POST",
					body: formData
				})
				.then(response => response.json())
				.then(response => {
					this.requestError = '';
					if(response.type == 'error')
					{
						this.requestError = response.message;
					}
					else
					{
						this.$modal.hide('card_windows');
						this.$modal.show('success_windows');
					}
				})
				.catch(function(res){ console.log(res) })
			},
			selectPaysystem(paysystem)
			{
				this.paysystem = paysystem;
			},
			setDefaultPaysystem(){
				this.paysystem = 'paypal';
			},
			showPaysystemModal(){
				// this.$modal.show('select_paysystem' + this.plan);
				this.$modal.show('card_windows');
				// this.$modal.show('success_windows' + this.plan);
			},
			showCardModal(){
				this.$modal.hide('select_paysystem');
				this.$modal.show('card_windows');
			},
			hideModal(modalName)
			{
				this.$modal.hide(modalName);
				location.href = "/posts";
			},
			updateCardNumber (val) {
			},
			updateCardName (val) {
			},
			updateCardMonth (val) {
			},
			updateCardYear (val) {
			},
			updateCardCvv (val) {
			}
		},
		watch: {
			paysystem(value) {
				console.log(value)
			  if(value == 'card')
				this.showCardModal()
			}
		},
        mounted() {
			// this.$i18n.locale = navigator.language
			this.$i18n.locale = 'es';
        }
    };
</script>

